import React from "react";


const RetList = (props) =>{
   
    const RemoveElement = (event)=>{
        const id = event.target.id ; 
        const toDel = props.data[id] ;
        console.log(toDel);

        props.SetV((preList)=>{
            return preList.filter((toDel,id)=>{
                index !== id ; 
            }) ; 
        });

    }
    const data = props.data.map((val , index)=>{
        return (
        <p key={index}><button id ={index}className="btnSub"onClick={RemoveElement}>
        -</button> {val} 
        </p>
         );
    }) ; 
    return data ; 
}

